#!/usr/bin/env python3
"""Run this from your git repo root: python setup.py"""
import base64, gzip, tarfile, io, os

DATA = ""

os.makedirs("MigrationScheduler", exist_ok=True)
os.chdir("MigrationScheduler")
raw = gzip.decompress(base64.b64decode(DATA))
tar = tarfile.open(fileobj=io.BytesIO(raw))
tar.extractall(".")
tar.close()
print(f"Extracted {len(tar.getnames())} files into MigrationScheduler/")
print("Done! Now run:")
print("  git add MigrationScheduler/")
print('  git commit -m "Add Honeywell Experion Migration Project Scheduler"')
print("  git push -u origin main")
